import {Link} from 'react-router-dom';
import './PokemonCard.scss';
function PokemonCard(props){
    console.log(props);

    let poke=props.pokemon;
    return (


            <Link className="card text-white bg-dark mb-3 poke-card" >
                <img className='card-img-top poke-image' src={poke.image} alt='Failed to load'/>
                <div className="card-body">
                    <h3 className='card-title'>{poke.name}</h3>
                </div>
            </Link>            

    )
}




export default PokemonCard
